import React, { useState } from "react";

export default function Register1()
{
    const [user,setuser]=useState("");
    const [pass,setpass]=useState("");
    const [email,setemail]=useState("");
    const [companyname,setcompanyname]=useState("");
    const fromdata=new FormData();
    fromdata.append('username',user);
    fromdata.append('password',pass);
    fromdata.append('email',email);
    fromdata.append('companyname',companyname);

    const SaveData=(event)=>{
        event.preventDefault();
        axios.post("http://localhost:9090/comreg",fromData).then(response => {
            const responseData = response.data;
            window.alert(responseData)
            if(responseData==="Success")
            window.location.replace('http://localhost:3000/comlogin')
        });
    }

    return(
        <div>
            <h2>Hello Company Register Here</h2>
            <form onSubmit={SaveData}>
                Username : <input type="text" value={user} placeholder="Enter Username" name="user" required onChange={(e)=>{setuser(e.target.value)}}></input>
                Password : <input type="password" value={pass} placeholder="Enter Password" name="pass" required onChange={(e)=>{setpass(e.target.value)}}></input>
                Email : <input type="email" value={email} placeholder="Enter Email" name="email" required onChange={(e)=>{setemail(e.target.value)}}></input>
                Company Name : <input type="text" value={companyname} placeholder="Enter Company Name" name="companyname" required onChange={(e)=>{setcompanyname(e.target.value)}}></input>
                <button type="submit">Register</button>
            </form>
        </div>
    );
}
